import itertools; import math; import operator; import random; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from heapq import *; import unittest; from typing import List;
def get_sol(): return Solution()

class Solution:
    # https://leetcode.com/problems/jump-game-vii/discuss/1224681/Python3-Implicity-BFS
    # https://www.youtube.com/watch?v=v1HpZUnQ4Yo
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        q = deque([0])
        max_reached = 0
        while q:
            cur = q.popleft()
            if cur == len(s) - 1:
                return True
            start = max(cur + minJump, max_reached+1)
            end = min(cur + maxJump + 1, len(s))
            for i in range(start, end):
                if s[i] == '0':
                    q.append(i)
            max_reached = cur + maxJump
        return False

