class Solution3:
    # tle
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        n=len(s)
        dp={}
        def helper(i):
            if i>=n: return False
            if s[i]=='1': return False
            if i==n-1 and s[i]=='0': return True
            if i in dp: return dp[i]
            dp[i]=helper(i+1)
            if dp[i]==True: return True
            ans=False
            for jump in reversed(range(minJump,maxJump+1)): # including maxJump
                ans = ans or helper(i+jump)
            dp[i]=ans
            return ans

        if s[n-1]=='1': return False
        return helper(0)


